import ImageComponent from './components/ImageComponent';
import FooterComponent from './components/FooterComponent';

function App() {
  return (
    <>
    <Router>
    <div className="App">
      <HeaderComponent />
      <div class="container">
        {/* <CategoriesComponent />
        <RecommendedComponent />
        <ImageComponent /> */}
        <Route path='/cat' component={CategoriesComponent}></Route>
        <Route path='/rec' component={RecommendedComponent}></Route>
        <Route path='/img' component={ImageComponent}></Route>
      </div>  
      {/* <FooterComponent /> */}
      <Route path='/footer' component={FooterComponent}></Route>



        <Route path='/products' component={RecommendedComponent}></Route>
        </div>
    </Router>

    </>

  );
}
export default App;
